def f(k):
    return sum([(5*n-1)/k**n for n in range(1,100)])

def f_prime(k):
    return sum([-n*(5*n-1)/k**(n+1) for n in range(1,100)])

def newton(f, f_prime, x0, epsilon):
    x = x0
    while abs(f(x)) > epsilon:
        x = x - f(x)/f_prime(x)
    return x

print(newton(f, f_prime, 1.5, 1e-10))

